import React, { Component } from 'react'

class Checks extends Component {
    render() {
        const displayChecks = () =>{
            for(let i = 0; i < 8; i++){
                return(
                    <div classname="onedailygoalcheckmark">
                        <ul>
                            <li>
                                <label className="checkbox">
                                    <input type="checkbox" />
                                    <span class="checkmark"></span>
                                </label>
                            </li>
                        </ul>
                    </div>
                )
            }
        }
        return (
            <div>
                {displayChecks}
            </div>
        )
    }
}

export default Checks
